import React, { Component } from 'react';

class AddBookListComponent extends Component {
    constructor(props){
        super(props)

        this.state = {
            books: []

        }
    }
    render() {
        return (
            <div>
                <h2>BookList Form</h2>
            </div>
        );
    }
}

export default AddBookListComponent;
